import React from "react";
import styles from "./Home.module.css";

function Home() {
  return (
    <article>
      {" "}
      <div className={styles.home}>
        <div className={styles.title}>Breathe Safety Index</div>
        <img
          src="./smoke.png"
          alt="People wearing masks"
          className={styles.image}
        />
        <div className={styles.description}>
          Assessment of the effects of outdoor air quality on human health and
          well-being
        </div>
      </div>
    </article>
  );
}

export default Home;
